import { Route, Switch } from 'react-router-dom';
import './App.css';
import Side_bar from './Component/Side_bar';
import {BrowserRouter as Router} from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
         <Side_bar/>
         <Switch>
           <Route path="/"/>
         </Switch>
    </Router>
    </>
  );
}

export default App;
